import  React, { useState } from 'react';
import {TextField ,Button }from '@mui/material';

export default function FreeSolo() {
  const [value,setValue]=useState('');
  const [bookList,setbookList]=useState([]);
  const [openSearchResult,setOpenSearchResult]=useState(false);
  const onChange=(e)=>{
    setValue(e.target.value);
  }
    return (
     <><TextField onChange={onChange} label="What are you looking for..." variant="outlined" size="small" style={{ marginRight: "10px", marginTop: "20px", width: "422px" }} />
     {openSearchResult && (
      <div >
        {bookList?.length===0 && (
          <p >No product Found</p>
        )}
        <list>
          {bookList?.length>0 &&
          bookList.map((item,i)=>{
            return(
              <listItem key={i}>
                <div>
                  <div>
                    <span>{item.name}</span>
                    <p>{item.description}</p>
                  </div>
                  <div>
                    <span>
                      {item.price}
                    </span>
                    <link onClick={()=>addToCart(item)}>
                      Add to Cart
                    </link>
                  </div>
                </div>
              </listItem>
            )
          })}
        </list>
      </div>

     )}
     <Button variant="contained" color="success" style={{ marginInline: "10px", marginTop: "20px", height: "40px" }}>
        Success
      </Button>
      </>
      
    );
  }
